g2:c.PROCEDURE.g2:a.TEXT:
t-g2-get-subclasses-interactive-test(node: class benchmark-node )
error-obj: class error;
result : sequence = sequence(); 
one_subclass_seq : sequence = sequence(the symbol semi);
oil_rig_seq : sequence = sequence(the symbol toyota);
two_subs_seq : sequence = sequence(the symbol sony, the symbol lg);
mul_subs_seq : sequence = sequence(the symbol radio_1, the symbol radio_2, the symbol radio_3);
messy_subs_seq : sequence = sequence(the symbol computer_A, the symbol computer_B, the symbol computer_C, the symbol computer_E);
tr-val : truth-value;

begin
    //1)  get subclasses of an invalid_item
    begin
        result = call g2-get-direct-subclasses(invalid_item); 
    end
    on error ( error-obj )
    if result /= sequence() then begin
        call fail( node, "Expected an empty sequence but the result was [result]");
        return;
    end;
    end;


    // 2)  object with no subclasses.
    result = call g2-get-direct-subclasses(the symbol car);
    if result /= sequence() then begin
        call fail(node, "Expected an empty sequence but the result was [result]");
        return;
    end;   


    // 3)  object with one subclasses.
    result = call g2-get-direct-subclasses(the symbol truck);
    if result /= one_subclass_seq then begin
        call fail(node, "Expected a sequence  [one_subclass_seq] but the result was [result]");
        return;
    end;   



    // 4)  oil rig hierarchy
    result = call g2-get-direct-subclasses(the symbol pickup);
    if result /= oil_rig_seq then begin
        call fail(node, "Expected a sequence  [oil_rig_seq] but the result was [result]");
        return;
    end;   



    // 5)  two direct subclasses
    result = call g2-get-direct-subclasses(the symbol tv);
    tr-val = call check-2-seq-equality(result,two_subs_seq);
    if  tr-val /= true  then begin
        call fail(node, "Expected a sequence  [two_subs_seq] but the result was [result]");
        return;
    end;   



    // 6)  multiple direct subclasses
    result = call g2-get-direct-subclasses(the symbol radio);
    tr-val = call check-2-seq-equality(result,mul_subs_seq); 
    if  tr-val /= true then begin
        call fail(node, "Expected a sequence  [mul_subs_seq] but the result was [result]");
        return;
    end;   



    // 7)  with messy inheritance graphs
    result = call g2-get-direct-subclasses(the symbol computer);
    tr-val = call check-2-seq-equality(result,messy_subs_seq); 
    if tr-val /= true then begin
        call fail(node, "Expected a sequence  [messy_subs_seq] but the result was [result]");
        return;
    end;   

  
call pass(node);
end

check-2-seq-equality(seq_1:sequence, seq_2:sequence)=(truth-value)
x1,x2 : integer;
sym1, sym2: symbol;
begin
x1 = the number of elements in seq_1;
x2 = the number of elements in seq_2;

if x1 /= x2 then
return false;   

   for sym1= each  symbol in seq_1
       do 
          if  sym1  is not a member of seq_2    then
            return false;
       end;

return true; 
end

t-g2-get-subclasses-programmatic-test(node: class benchmark-node )
error-obj: class error;
CD1 : class item;
CD2,CD2_1 : class item;
CD3,CD3_1,CD3_2 : class item;
CD4,CD4_1,CD4_2 : class item;
CD5,CD5_1,CD5_2,CD5_3 : class item;
CD6,CD6_1,CD6_2,CD6_3 : class item;

result : sequence = sequence(); 
one_sub_seq : sequence = sequence(the symbol lamp2_1);
oil_rig_seq : sequence = sequence(the symbol lamp3_1);
dir_sub_seq : sequence = sequence(the symbol lamp4_1, the symbol lamp4_2);
mul_sub_seq : sequence = sequence(the symbol lamp5_1, the symbol lamp5_2, the symbol lamp5_3);
messy_sub_seq : sequence = sequence(the symbol lamp6_1, the symbol lamp6_2, the symbol lamp6_3);


begin
  

// 1) Object with no subclasses.

    create a class-definition CD1;
    conclude that the class-name of CD1 = the symbol  lamp1;
    conclude that the direct-superior-classes of CD1 = sequence(the symbol object);
    transfer CD1 to this workspace;
    make CD1 permanent;

    result = call g2-get-direct-subclasses(the symbol lamp1);
    if result /= sequence() then begin
        call fail(node, "Expected an empty sequence but the result was [result]");
        return;
    end;   
    
    delete  CD1 without permanence checks;



// 2)  Object with one subclass

    create a class-definition CD2;
    conclude that the class-name of CD2 = the symbol  lamp2;
    conclude that the direct-superior-classes of CD2 = sequence(the symbol object);
    transfer CD2 to this workspace;
    make CD2 permanent;

    create a class-definition CD2_1;
    conclude that the class-name of CD2_1 = the symbol  lamp2_1;
    conclude that the direct-superior-classes of CD2_1 = sequence(the symbol lamp2, the symbol object);
    transfer CD2_1 to this workspace;
    make CD2_1 permanent;

    result = call g2-get-direct-subclasses(the symbol lamp2);
    if result /= one_sub_seq then begin
        call fail(node, "Expected a sequence [one_sub_seq] but the result was [result]");
        return;
    end;   
    
    delete  CD2 without permanence checks;
    delete  CD2_1 without permanence checks;



//   3) Oil rig hierarchy.

    create a class-definition CD3;
    conclude that the class-name of CD3 = the symbol  lamp3;
    conclude that the direct-superior-classes of CD3 = sequence(the symbol object);
    transfer CD3 to this workspace;
    make CD3 permanent;

    create a class-definition CD3_1;
    conclude that the class-name of CD3_1 = the symbol  lamp3_1;
    conclude that the direct-superior-classes of CD3_1 = sequence(the symbol lamp3, the symbol object);
    transfer CD3_1 to this workspace;
    make CD3_1 permanent;
    
    create a class-definition CD3_2;
    conclude that the class-name of CD3_2 = the symbol  lamp3_2;
    conclude that the direct-superior-classes of CD3_2 = sequence(the symbol lamp3_1, the symbol object);
    transfer CD3_2 to this workspace;
    make CD3_2 permanent;
    
    result = call g2-get-direct-subclasses(the symbol lamp3);
    if result /= oil_rig_seq then begin
        call fail(node, "Expected a sequence [oil_rig_seq] but the result was [result]");
        return;
    end;   
    
    delete  CD3 without permanence checks;
    delete  CD3_1 without permanence checks;
    delete  CD3_2 without permanence checks;




//   4) 2 direct subclasses.

    create a class-definition CD4;
    conclude that the class-name of CD4 = the symbol  lamp4;
    conclude that the direct-superior-classes of CD4 = sequence(the symbol object);
    transfer CD4 to this workspace;
    make CD4 permanent;

    create a class-definition CD4_1;
    conclude that the class-name of CD4_1 = the symbol  lamp4_1;
    conclude that the direct-superior-classes of CD4_1 = sequence(the symbol lamp4, the symbol object);
    transfer CD4_1 to this workspace;
    make CD4_1 permanent;
    
    create a class-definition CD4_2;
    conclude that the class-name of CD4_2 = the symbol  lamp4_2;
    conclude that the direct-superior-classes of CD4_2 = sequence(the symbol lamp4, the symbol object);
    transfer CD4_2 to this workspace;
    make CD4_2 permanent;
    
    result = call g2-get-direct-subclasses(the symbol lamp4);
    if result /= dir_sub_seq then begin
        call fail(node, "Expected a sequence [dir_sub_seq] but the result was [result]");
        return;
    end;   
    
    delete  CD4 without permanence checks;
    delete  CD4_1 without permanence checks;
    delete  CD4_2 without permanence checks;



//   5) multiple direct subclasses.

    create a class-definition CD5;
    conclude that the class-name of CD5 = the symbol  lamp5;
    conclude that the direct-superior-classes of CD5 = sequence(the symbol object);
    transfer CD5 to this workspace;
    make CD5 permanent;

    create a class-definition CD5_1;
    conclude that the class-name of CD5_1 = the symbol  lamp5_1;
    conclude that the direct-superior-classes of CD5_1 = sequence(the symbol lamp5, the symbol object);
    transfer CD5_1 to this workspace;
    make CD5_1 permanent;
    
    create a class-definition CD5_2;
    conclude that the class-name of CD5_2 = the symbol  lamp5_2;
    conclude that the direct-superior-classes of CD5_2 = sequence(the symbol lamp5, the symbol object);
    transfer CD5_2 to this workspace;
    make CD5_2 permanent;
    
    create a class-definition CD5_3;
    conclude that the class-name of CD5_3 = the symbol  lamp5_3;
    conclude that the direct-superior-classes of CD5_3 = sequence(the symbol lamp5, the symbol object);
    transfer CD5_3 to this workspace;
    make CD5_3 permanent;
    
    result = call g2-get-direct-subclasses(the symbol lamp5);
    if result /= mul_sub_seq then begin
        call fail(node, "Expected a sequence [mul_sub_seq] but the result was [result]");
        return;
    end;   
    
    delete  CD5 without permanence checks;
    delete  CD5_1 without permanence checks;
    delete  CD5_2 without permanence checks;
    delete  CD5_3 without permanence checks;





//   6) classes with messy inheritance graphs. 

    create a class-definition CD6;
    conclude that the class-name of CD6 = the symbol  lamp6;
    conclude that the direct-superior-classes of CD6 = sequence(the symbol object);
    transfer CD6 to this workspace;
    make CD6 permanent;

    create a class-definition CD6_1;
    conclude that the class-name of CD6_1 = the symbol  lamp6_1;
    conclude that the direct-superior-classes of CD6_1 = sequence(the symbol lamp6, the symbol object);
    transfer CD6_1 to this workspace;
    make CD6_1 permanent;
    
    create a class-definition CD6_2;
    conclude that the class-name of CD6_2 = the symbol  lamp6_2;
    conclude that the direct-superior-classes of CD6_2 = sequence(the symbol lamp6_1, the symbol lamp6, the symbol object);
    transfer CD6_2 to this workspace;
    make CD6_2 permanent;
    
    create a class-definition CD6_3;
    conclude that the class-name of CD6_3 = the symbol  lamp6_3;
    conclude that the direct-superior-classes of CD6_3 = sequence(the symbol lamp6_2, the symbol lamp6, the symbol object);
    transfer CD6_3 to this workspace;
    make CD6_3 permanent;
    
    result = call g2-get-direct-subclasses(the symbol lamp6);
    if result /= messy_sub_seq then begin
        call fail(node, "Expected a sequence [messy_sub_seq] but the result was [result]");
        return;
    end;   
    
    delete  CD6 without permanence checks;
    delete  CD6_1 without permanence checks;
    delete  CD6_2 without permanence checks;
    delete  CD6_3 without permanence checks;






call pass(node);
end
